import REPO_ACTIONS from './repo.actionTypes';

export const fetchRepos=(userName)=>{
    return{
        type:REPO_ACTIONS.FETCH_REPO_DATA,
        payload:userName
    }

}

export const fetchRepoSucess=data=>{
    return{
        type:REPO_ACTIONS.FETCH_REPO_SUCCESS,
        payload:data
    }
}

export const fetchRepoFailure=data=>{
    return{
        type:REPO_ACTIONS.FETCH_REPO_FAILURE,
        payload:data
    }
}
